import React, { useEffect, useState } from "react";

const C = () => {
  const [data, setdata] = useState([]);
  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/comments")
      .then((response) => response.json())
      .then((json) => setdata(json));

    console.log(data);
  },[]);

  return (
    <>
      {data.map((jsondata) => (
        <>
          <div>
            <div id='cont1' style='border:2px solid red'>
            <div><input>{jsondata.body}</input></div>
            <div><h3>{jsondata.postId}</h3></div>
            <div><p>{jsondata.name}</p></div>
            <div><h5>{jsondata.email}</h5></div>
            <div><h3>{jsondata.id}</h3></div>
            </div>
          </div>
        </>
      ))}
    </>
  );
};
export default C;
